INSERT INTO `assessment_criterionoption` VALUES (1,0,0,'Off Topic','Off Topic','The essay is off-topic or does not answer all or part of the question.',1),(2,1,5,'No Explanation','No Explanation','A meal is described, but no argument is made to persuade the reader to try it.',1),(3,2,5,'Unclear recommendation','Unclear recommendation','A meal is not described, but an argument is made to persuade the reader to try it.',1),(4,3,10,'Persuasive recommendation','Persuasive recommendation','The essay give a good description of the meal and provides supporting reasons for trying the meal.',1),(5,0,0,'Confusing','Confusing','It is difficult to identify the argument and main idea.',2),(6,1,1,'Basic Structure','Basic Structure','The essay provides a main idea. Additional details are provided, and some support the main idea.',2),(7,2,2,'Clear Structure','Clear Structure','The essay provides a clear main idea supported by specific details.',2),(8,3,3,'Complete Structure','Complete Structure','The essay has a complete structure: an introduction, statement of main idea, supporting details and summary.',2),(9,0,0,'Unconvincing','Unconvincing','The author did not present a persuasive argument, and I have no interest in trying this meal.',3),(10,1,2,'Interesting','Interesting','The author’s argument was somewhat persuarsive. I need more information to consider trying this meal.',3),(11,2,4,'Persuasive','Persuasive','The author’s argument was persuasive, and I will consider trying the meal.',3),(12,3,6,'Inspiring','Inspiring','The author presented an exceptionally strong case and has convinced me to try the meal.',3),(13,0,0,'Poor','Poor','Difficult for the reader to discern the main idea.  Too brief or too repetitive to establish or maintain a focus.',4),(14,1,3,'Fair','Fair','Presents a unifying theme or main idea, but may include minor tangents.  Stays somewhat focused on topic and task.',4),(15,2,5,'Good','Good','Presents a unifying theme or main idea without going off on tangents.  Stays completely focused on topic and task.',4),(16,0,0,'Poor','Poor','Includes little information with few or no details or unrelated details.  Unsuccessful in attempts to explore any facets of the topic.',5),(17,1,1,'Fair','Fair','Includes little information and few or no details.  Explores only one or two facets of the topic.',5),(18,2,3,'Good','Good','Includes sufficient information and supporting details. (Details may not be fully developed; ideas may be listed.)  Explores some facets of the topic.',5),(19,3,3,'Excellent','Excellent','Includes in-depth information and exceptional supporting details that are fully developed.  Explores all facets of the topic.',5),(20,0,10,'Poor','Not Satisfactory','I did not select either an audience or a change.',6),(21,1,40,'Fair','Needs Improvement','I selected an audience and a change. However, I was not specific about my audience or change. \nGood example: Voters in my state\nBad example: The public',6),(22,2,50,'Good','Good','I selected an audience and a change. I was specific about my audience and change. \nGood example: Voters in my state\nBad example: The public',6),(23,0,10,'Poor','Not Satisfactory','I did not specify either the motivation, policy window, or framing of my advocacy strategy.',7),(24,1,40,'Fair','Needs Improvement','I specified the motivation, policy window, and framing of my advocacy strategy. However, I did not explain why I chose the three dimensions of my advocacy strategy.',7),(25,2,50,'Good','Good','I specified the motivation, policy window, and framing of my advocacy strategy. I explained why I chose the three dimensions of advocacy strategy.',7),(26,0,20,'Poor','No','The learner did not use the Advocacy Strategy Framework correctly. At least one tactic will not produce the desired change in the chosen audience.',8),(27,1,100,'Fair','Yes','The learner used the Advocacy Strategy Framework correctly. Both tactics will produce the desired change in the chosen audience.',8),(28,0,10,'Poor','No','No, the learner did not identify the problem that this organization is trying to solve.',9),(29,1,50,'Fair','Yes','Yes, the learner identified the problem that this organization is trying to solve.\nCorrect responses include:\nHealthGAP observed that patients with HIV/AIDS in developing countries did not have access to life-saving drugs.\nWIEGO observed that informal workers did not have access to labor rights.',9),(30,0,10,'Poor','No','No, the learner did not identify one actor’s desired behavior change, power, and motivation.',10),(31,1,50,'Fair','Yes','Yes, the learner identified one actor’s desired behavior change, power, and motivation.\nCorrect responses include:\nHealthGAP wanted Al Gore to abandon a certain policy towards South Africa. He had the power to make the decision, and did not want his public reputation to suffer.\nWIEGO wanted the city of Bogota to grant more rights and economic security to the trash pickers. They had the power to provide these services, but had to be persuaded by a court ruling.',10),(32,0,6,'Poor','No','No, the learner did not complete all three steps.',11),(33,1,32,'Fair','Yes','Yes, the learner completed all three steps.',11),(34,0,7,'Poor','No','No, this interim outcome is not specific about who will change or how they will change.',12),(35,1,33,'Fair','Yes','Yes, this interim outcome is specific about who will change or how they will change.',12),(36,0,7,'0','No','No, this interim outcome is not linked to the tactic. It is not a good fit.',13),(37,1,33,'1','Yes','Yes, this interim outcome is directly linked to the tactic. It is a good fit.',13),(38,0,10,'Poor','No','No, they did not complete at least one part of the risk analysis tool.',14),(39,1,50,'Fair','Yes','Yes, they completed every part of the risk analysis tool.',14),(40,0,10,'Poor','No','No, the mitigation strategies that they selected will not reduce the seriousness of the risks.',15),(41,1,50,'Fair','Yes','Yes, the mitigation strategies that they selected will reduce the seriousness of the risks.',15),(42,0,0,'Poor','Poor','Difficult for the reader to discern the main idea.  Too brief or too repetitive to establish or maintain a focus.',16),(43,1,3,'Fair','Fair','Presents a unifying theme or main idea, but may include minor tangents.  Stays somewhat focused on topic and task.',16),(44,2,5,'Good','Good','Presents a unifying theme or main idea without going off on tangents.  Stays completely focused on topic and task.',16),(45,0,0,'Poor','Poor','Includes little information with few or no details or unrelated details.  Unsuccessful in attempts to explore any facets of the topic.',17),(46,1,1,'Fair','Fair','Includes little information and few or no details.  Explores only one or two facets of the topic.',17),(47,2,3,'Good','Good','Includes sufficient information and supporting details. (Details may not be fully developed; ideas may be listed.)  Explores some facets of the topic.',17),(48,3,3,'Excellent','Excellent','Includes in-depth information and exceptional supporting details that are fully developed.  Explores all facets of the topic.',17),(49,0,20,'Poor','No','No, I did not list all of the products or services that my project will provide. I did not list quality or quantity requirements.',18),(50,1,100,'Fair','Yes','Yes, I listed all of the products or services that my project will provide, including quality and quantity requirements.',18),(51,0,20,'Poor','No','The learner did not list at least 10 activities. They did not say when each activity would happen.',19),(52,1,100,'Fair','Yes','The learner listed at least 10 activities. They said when each activity would happen.',19),(53,0,10,'Poor','Not satisfactory','The learner analyzed fewer than five stakeholders.',20),(54,1,40,'Fair','Needs improvement','The learner analyzed five project stakeholders. However, they did not fill in every part of the worksheet.',20),(55,2,50,'Good','Good','The learner completely analyzed five project stakeholders. Every area was filled in.',20),(56,0,10,'Poor','Not satisfactory','The learner did not say how they would engage with each stakeholder.',21),(57,1,40,'Fair','Needs improvement','The learner said how they would engage with each stakeholder. However, their strategies are not very specific or they do not seem like good choices given the information provided.',21),(58,2,50,'Good','Good','The learner specified exactly how they will engage with their stakeholders. The strategies that they have chosen seem like good choices given the information provided.',21),(59,0,20,'Poor','No','I did not assign a responsible, an accountable, a consulted, and an informed person to each task.',22),(60,1,100,'Fair','Yes','I assigned a responsible, an accountable, a consulted, and an informed person to each task.',22);
