INSERT INTO `certificates_certificatetemplate` VALUES (1,'2019-08-22 13:54:03.347858','2019-08-23 13:25:14.818632','Philu Certification','Computer certification','<!DOCTYPE html>\r\n<html lang=\"en\">\r\n<head>\r\n    <meta charset=\"UTF-8\">\r\n    <title>PhilanthropyU Certificate</title>\r\n    <link href=\"https://fonts.googleapis.com/css?family=Montserrat:400,500\" rel=\"stylesheet\"/>\r\n    <link rel=\"icon\" type=\"image/x-icon\" href=\"https://s3.eu-central-1.amazonaws.com/philanthropyu-static/favicon.png\"/>\r\n    <link rel=\"stylesheet\" href=\"https://static.philanthropyu.org/certificate-css/certificate.css\"/>\r\n</head>\r\n<body>\r\n\r\n<main class=\"accomplishment-main  ${border_class}\">\r\n\r\n    <div class=\"social-links-holder\">\r\n        <div class=\"social-links\">\r\n            <span>Share your accomplishment!</span>\r\n            <a class=\"social-icons use-popup\" target=\"_blank\"\r\n               href=\"${social_sharing_urls[\'facebook\']}\"\r\n               onclick=\"positionedPopup(this.href);return false\">\r\n                <img src=\"https://s3.eu-central-1.amazonaws.com/philanthropyu-static/social-icons/facebook-icon.svg\"\r\n                     title=\"Share this certificate on Facebook\">\r\n            </a>\r\n            <a class=\"social-icons use-popup\" target=\"_blank\"\r\n               href=\"${social_sharing_urls[\'twitter\']}\"\r\n               onclick=\"positionedPopup(this.href);return false\">\r\n                <img src=\"https://s3.eu-central-1.amazonaws.com/philanthropyu-static/social-icons/twitter-icon.svg\"\r\n                     title=\"Share this certificate on Twitter\">\r\n            </a>\r\n        </div>\r\n    </div>\r\n\r\n    <div class=\"accomplishment\">\r\n        <div class=\"accomplishment-rendering\">\r\n\r\n            <div class=\"accomplishment-statement\">\r\n                <h3 class=\"accomplishment-title\">Certificate of Achievement</h3>\r\n                <h5 class=\"accomplishment-course-date\">Awarded on ${certificate_date_issued}</h5>\r\n                <h1 class=\"accomplishment-recipient\">${accomplishment_copy_name | h}</h1>\r\n                <h5 class=\"clr-bluish-grey\">For successfully completing the course</h5>\r\n                <h4 class=\"accomplishment-course-name\">${accomplishment_copy_course_name}</h4>\r\n                <p class=\"accomplishment-course-summary\">${accomplishment_copy_description_full}</p>\r\n            </div>\r\n\r\n            <ul class=\"accomplishment-signatories\">\r\n              % if certificate_data:\r\n                % for signatory in certificate_data.get(\'signatories\', []):\r\n                  % if signatory[\'name\'] or signatory[\'title\'] or signatory[\'organization\'] or signatory[\'signature_image_path\']:\r\n                    <li class=\"accomplishment-signatory\">\r\n                      <h4 class=\"signatory-name\">${signatory[\'name\']}</h4>\r\n                      <h5 class=\"role-organization\">${signatory[\'title\']}${\', %s\' % signatory[\'organization\'] if signatory[\'organization\']!=\'\' else \'\'}</h5>\r\n                      % if signatory[\'signature_image_path\']:\r\n                        <img src=\"${signatory[\'signature_image_path\']}\" alt=\"${signatory[\'name\']}\"/>\r\n                      % endif\r\n                    </li>\r\n                  % endif\r\n                % endfor\r\n              % endif\r\n            </ul>\r\n\r\n          <span class=\"disclaimer\">\r\n            Philanthropy University is a non-degree, diploma or credit granting initiative of Philanthropy U, the\r\n            nonprofit sponsor and concept developer of the product. Learners are not entitled to earn college or\r\n            other academic credit.\r\n          </span>\r\n        </div>\r\n    </div>\r\n\r\n</main>\r\n<script>\r\n    var popupWindow = null;\r\n\r\n    function positionedPopup(url) {\r\n        settings =\r\n            \'height=450, width=550, toolbar=0, location=0, menubar=0, directories=0, scrollbars=0\' + \',resizable=yes\'\r\n        popupWindow = window.open(url, \'Philu\', settings)\r\n    }\r\n</script>\r\n</body>\r\n</html>',NULL,'','honor',1,'');
/*!40000 ALTER TABLE `certificates_certificatetemplate` ENABLE KEYS */;
UNLOCK TABLES;

